import React from "react";
import Button from "@material-ui/core/Button";
import { formDataToObject } from "./utils";
import ATextField from "./aTextField";

function handleSubmit(event) {
  event.preventDefault();
  const formData = new FormData(event.target);
  console.log("handleSubmit: " + JSON.stringify(formDataToObject(formData)));
}

const AForm = (props) => {
  return (
    <form onSubmit={handleSubmit}>
      <ATextField name="id" defaultValue="123" mode="disabled" />
      <ATextField name="hiddenField" defaultValue="abc" mode="hidden" />
      <ATextField name="firstName" defaultValue="abc" mode="hidden" />
      <ATextField name="lastName" />
      <ATextField
        name="address1"
        label="Address"
        autocompleteOptions={[
          { label: "Label 1", value: "Value 1" },
          { label: "Label 2", value: "Value 2" },
        ]}
        autocompleteGetOptionLabel={(option) => option.value}
      />
      <ATextField
        label="Star Wars API"
        autocompleteService="test"
        autocompleteGetOptionLabel={(option) => option.name}
      />
      <ATextField label="Comments" multiline />

      <Button type="submit">Submit</Button>
    </form>
  );
};

export default AForm;
